Sex Story: Fifty Shades of Grey 
Sex Story: Fifty Shades of Grey examines the phenomenon of the UK's fastest selling paperback of all time. Has Fifty Shades of Grey really transformed us from a nation of prudes to one of happy spankers? It may have brought bondage into the mainstream, but are the British really ready to embrace sexual experimentation? From visiting a spanking class, where novices are trained in the art of a good caning, to exploring the world of an S&amp;M couple who have written sex contracts with each other and have honed their more extreme practice to perfection, this documentary uncovers what the Fifty Shades of Grey craze tells us about 21st-century Britain. The programme examines the sociological and cultural effects the book is having in the UK, as sales of obscure classical music and bondage gear increase.

